r />\n( mau konsultasi apa? )','','2018-12-04 09:36:22'),(356,63,58,'1. Cek web prlotus.com<br />\n2. Cek server firstmedia.com','','2018-12-04 10:21:30'),(357,100,54,'buat desain untuk promodesain dan DS','[{\"file\":\"04122018104823_highlight-story1.jpg\"},{\"file\":\"04122018104823_highlight-story2.jpg\"},{\"file\":\"04122018104823_highlight-story3.jpg\"},{\"file\":\"04122018104823_device1.jpg\"},{\"file\":\"04122018104823_device2.jpg\"},{\"file\":\"04122018104823_device3.jpg\"},{}]','2018-12-04 10:48:23'),(358,69,57,'Update database<br />\nAhimsa ','[{<p>The filetype you are attempting to upload is not allowed.</p>},{}]','2018-12-04 10:49:04'),(359,98,54,'desain revisi alt 1','[{\"file\":\"04122018105012_homepage-allfilm-revisi-1.jpg\"},{\"file\":\"04122018105012_homepage-allfilm-revisi-1-mobile.jpg\"},{}]','2018-12-04 10:50:12'),(360,73,60,'Membuat Link ke halaman sesuai Url dari backend','','2018-12-04 11:27:21'),(361,62,57,'Membuat artikel untuk buatwebku','[{\"file\":\"05122018043901_Istilah_dalam_bisnis_online.zip\"},{}]','2018-12-05 04:39:01'),(362,56,60,'memahami flow invoice system','','2018-12-05 10:18:46'),(363,93,59,'revisi luka game','','2018-12-05 10:24:03'),(364,63,58,'1. Backup web siapkirimindonesia.com, apparelindonesia.net, jurnalibukota.com<br />\n2. Cek web dan server sahabatkecc.com<br />\n3. Cek email solusijuara.com','','2018-12-05 10:25:14'),(365,87,54,'- membuat halaman login, otp, lupa password<br />\n- membuat halaman dashboard','','2018-12-05 10:34:10'),(366,77,56,'desain landing page promo dan revisi desain landing page','','2018-12-05 13:48:09'),(367,63,58,'1. Backup web prlotus.com<br />\n2. Cek VPS sahabatkecc.com<br />\n3. Menonaktifkan email agatha@solusijuara.com dan ariany@solusijuara.com','','2018-12-06 10:29:16'),(368,87,54,'membuat desain :<br />\n<br />\nDASHBOARD<br />\n1. dashboard<br />\n2. Akun<br />\n3. tagihan<br />\n4. bantuan<br />\n<br />\nLOGIN<br />\n1. login<br />\n2. lupa npassword<br />\n3. OTP<br />\n4. popu