i<br />\nSolusi dengan menggunakan digital<br />\n<br />\nsejarah<br />\nPada tanggal 1 Mei tahun 1886 ada sekitar 4000.000 buruh di Amerika Serikat mengadakan demonstrasi besar-besaran untuk menuntut pengurangan jam kerja mereka menjadi 8 jam sehari yang sebelumnya pekerja dituntut bekerja selama 19 sampai 20 jam sehari. Aksi ini berlangsung selama 4 hari sejak tanggal 1 Mei.<br />\nSedangkan di Indonesia aksi ini dimulai pada tahun 1920 namun pada saat reformasi peringatan ini dilarang karena di ideologi kan sebagai komunis. <br />\nNamun pada tahun 1999 -2006 aksi ini berjalan dengan baik tanpa kericuhan. Kemudian pada tahun 2013 lalu setiap tanggal 1 Mei diperingati sebagai hari buruh. Untuk terus menyuarakan hak yang harus didapatkan buruh<br />\nIndustri<br />\nIndustri 1.0 - Mesin uap pada abad ke-18: Mesin uap<br />\nIndustri 2.0 - Teknologi industrial - pembangkit listrik: mesin bertenaga listrik<br />\nIndustri 3.0 - Revolusi digital - real time komunikasi: mesin berteknologi digital<br />\nIndustri 4.0 - Disruptif teknologi: kecerdasan buatan<br />\nMasalah yang dihadapi<br />\nJam kerja - upah - ilmu pengetahuan - persaingan - unjuk rasa<br />\nSolusi melalui media digital<br />\nUntuk menghadapi itu semua buruh diharuskan untuk meningkatkan kemampuan dan agar suara dan haknya tetap tersalurkan. Salah satunya website buruh online, info terbaru seputar kebijakan bisa Anda akses melalui portal tersebut.<br />\nKeuntungannya adalah keluhan dan hak dapat disuarakan dan disalurkan dengan benar melalui media ini.','','2019-04-30 10:07:09'),(685,126,54,'Membuat Desain homepage Bank INA','[{\"file\":\"30042019113253_homePage_BankIna.jpg\"},{}]','2019-04-30 11:32:53'),(686,63,58,'1. Mengurus pergantian dns kalyanashira.com dan kalyanashirafound.org<br />\n<br />\n2. Test email kalyanashira.com<br />\n<br />\n3. Backup web kotabaruparahyangan.com<br />\n<br />\n4. Install ulang windows 10 di PC Tison<br />\n','','2019-04-30 17:02:49'),(687,63,58,'1. Cek web dan hosting indonesiadev.com<br />\n2. Cek website klien DS','','2019-05-03 10:13:53'),(688,122,57,'membuat artikel<br />\nDigital Marketing Strategy Ramadhan<br />\nupdate social media ds instagram ','[{\"file\":\"06052019082438_Strategy_Digital_Marketing_Bulan_Ramadhan.zip\"},{}]','2019-05-06 08:24:38'),(689,63,58,'1. Cek hosting paulaco.id<br />\n2. Cek website klien DS','','2019-05-06 10:09:53'),(690,63,58,'1. Cek dan test perubahan IP web kalyanashira.org, kalyanashira.com, kalyanashirafound.org','','2019-05-07 08:55:13'),(691,63,58,'1. Cek dan test simulasi pergantian IP pada dua hosting cpanel leonnindonesia.com<br />\n2. Cek printer Canon MP145','','2019-05-08 09:00:57'),(692,63,58,'1. Test simulasi pergantian IP kalyanashira pada hosting leonnindonesia.com<br />\n2. Upload e2pay ke dewanstudio.biz/SIT/e2pay','','2019-05-09 09:10:01'),(693,122,57,'Social Media Content<br />\nWinning Ramadan With Digital by GOOGLE<br />\nYour Guide To Winning Ramadan<br />\nBanyak yang dilakukan selama bulan ramadan ini untuk meraih kemenangan, begitu pula dengan dunia digital, untuk dapatkan kemenangan di bulan ini kami sudah merangkum hasil laporan dari GOOGLE yang bertajuk Winning Ramadan With Digital, seperti apa? Simak postingan kami selanjutnya<br />\nFind Your Audience - Research content & keyword<br />\nTemukan siapa target Anda dan carilah konten serta keyword yang sesuai dengan kebutuhan mereka. Misalnya saat bulan ramadan ini banyak yang membutuhkan konten religi atau kebutuhan lainnya seperti “baju lebaran” sampai “tiket mudik” sesuaikan konten dengan kebutuhan yaa!<br />\nLaporan lengkapnya baca link di bio kita :)<br />\nCapture Their Attention - Different experience & KIS (Keep it simple) content<br />\nTarik perhatian mereka dengan pengalaman yang berbeda. Kemas konten dengan baik dan mudah diterima. Dapatkan perhatian dengan konten yang menimbulkan banyak interaksi!<br />\nTemukan tipsnya disini http://www.dewanstudio.com/strategy-digital-marketing-ramadhan/<br />\nConvert your customer - Optimize for action<br />\nOptimalkan keseluruhannya melalui format yang sesuai untuk dapatkan KPI (key performance indicator) yang tinggi. Ini penting jika Anda ingin mendapatkan hasil akhir yang memuaskan.<br />\nPastikan semua tahapan ini Anda lakukan ya!<br />\nLihat laporan lengkapnya dan temukan tips lainnya di link bio kita yaa!<br />\n<br />\nWEBSITE Content<br />\nSelamat Datang - Who we are<br />\nSELAMAT DATANG<br />\nDEWANSTUDIO adalah digital agency dan mitra yang tepat untuk semua kebutuhan bisnis digital Anda<br />\n(ABOUT US)<br />\n<br />\nAPP DEVELOPMENT<br />\nLayanan pembuatan APLIKASI MOBILE berbasis iOs dan Android untuk tingkatkan bisnis Anda ke level PREMIUM<br />\n(GET STARTED NOW)<br />\nWEB DEVELOPMENT<br />\nLayanan pembuatan WEBSITE yang mengutamakan pengalaman pengguna melalui proses UI dan UX untuk hasilkan PERFORMA terbaik<br />\n(GET STARTED NOW)<br />\n<br />\nONLINE MARKETING<br />\nSaatnya tingkatkan bisnis dengan DIGITAL MARKETING melalui strategy content, campaign, dan analisis untuk tarik perhatian banyak orang di SOCIAL MEDIA<br />\n(GET STARTED NOW)<br />\n<br />\nAPA YANG ANDA BUTUHKAN?<br />\nLIHAT APA YANG SUDAH KAMI KERJAKAN<br />\n(SHOW MORE)<br />\n<br />\nPosting artikel Digital Marketing Strategy Ramadan<br />\nPosting Instagram Dewanstudio','','2019-05-13 09:08:26'),(694,63,58,'1. Cek setting DNS kalyanashira.org<br />\n2. Test kecepatan web rahmaniafoundation.com','','2019-05-13 09:41:52'),(695,63,58,'1. Bantu Tison dalam isu akses situs FM di browser<br />\n2. Install ionic, cordova, android studio dan SDK di laptop Acer designer','','2019-05-15 09:23:33'),(696,63,58,'1. Install windows 10 sama setting yang lain di laptop Acer Designer buat building APK firstmedia<br />\n2. Test percobaan Ganti DNS buat kalyanashira','','2019-05-17 10:55:01'),(697,63,58,'1. Cek website klien DS<br />\n2. Test pergantian A record dan mx record pada DNS untuk web kalyanashira.com','','2019-05-20 09:26:04'),(6